<script>
    const text = document.getElementById('text');
    const indonesia = document.getElementById('Indonesia-2');
    const malaysia = document.getElementById('Malaysia-3');
    const brunei = document.getElementById('Brunei-2');
    const myanmar = document.getElementById('Myanmar-2');
    const thailand = document.getElementById('Thailand-2');
    const vietnam = document.getElementById('Vietnam-2');
    const laos = document.getElementById('Laos-2');
    const filipina = document.getElementById('Filipina-2');
    const kamboja = document.getElementById('Kamboja-2');
    const singapur = document.getElementById('singapura-3');

    text.style.position = "absolute";
    text.style.transition = "0.5s";
    text.style.opacity = "0";
    text.style.visibility = "hidden";

    function showCountryText(countryElement, countryName) {
        const position = countryElement.getBoundingClientRect();
        text.style.backgroundColor = "rgba(34, 60, 119, 0.8)";
        text.style.color = "#FCD116";
        text.style.top = `${position.top + (0.5 * position.height) + window.scrollY}px`;
        text.style.left = `${position.left + (0.5 * position.width) + window.scrollX}px`;
        text.style.visibility = "visible";
        text.style.opacity = "1";
        text.innerHTML = countryName;
    }

    function hideCountryText() {
        text.style.opacity = "0";
        text.style.visibility = "hidden";
        text.innerHTML = "";
    }


    // Function to handle the click event
    function setupCountryClick(countryElement, countryName) {
        countryElement.addEventListener('click', () => {
            window.location.href = `/summarymobile/econometric`
        });
    }

    // Adding event listeners for each country
    function setupCountryEvents(countryElement, countryName) {
        countryElement.addEventListener('mouseover', () => {
            countryElement.querySelectorAll('.cls-5').forEach((element) => {
                element.style.fill = 'yellow';
                element.style.transition = '0.5s';
            });
            showCountryText(countryElement, countryName);
        });

        countryElement.addEventListener('mouseout', () => {
            countryElement.querySelectorAll('.cls-5').forEach((element) => {
                element.style.fill = '#223c77';
            });
            hideCountryText();
        });

        // Add click event
        setupCountryClick(countryElement, countryName);
    }

    // Initialize events for each country
    setupCountryEvents(indonesia, "Indonesia");
    setupCountryEvents(malaysia, "Malaysia");
    setupCountryEvents(brunei, "Brunei");
    setupCountryEvents(myanmar, "Myanmar");
    setupCountryEvents(thailand, "Thailand");
    setupCountryEvents(vietnam, "Vietnam");
    setupCountryEvents(laos, "Laos");
    setupCountryEvents(filipina, "Filipina");
    setupCountryEvents(kamboja, "Kamboja");
    setupCountryEvents(singapur, "Singapura");
</script>

